create table sys_login_log
(
    id               BIGINT(19) auto_increment
        primary key,
    app_id           BIGINT(19)   null comment '应用id',
    user_id          BIGINT(19)   null comment '用户id',
    team_id          BIGINT(19)   null comment '团队id',
    username         VARCHAR(50)  null comment '登录账号',
    client_ip        VARCHAR(100) null comment '客户端ip',
    client_country   VARCHAR(50)  null comment '国家',
    client_province  VARCHAR(50)  null comment '省份',
    client_city      VARCHAR(50)  null comment '城市',
    client_operators VARCHAR(255) null comment '客户端运营商',
    browser          VARCHAR(100) null comment '浏览器',
    browser_version  VARCHAR(100) null comment '浏览器版本',
    os               VARCHAR(100) null comment '系统',
    os_version       VARCHAR(100) null comment '系统版本',
    login_type       INT(10)      null comment '登录方式',
    is_success       BIT          null comment '是否登录成功',
    create_time      DATETIME(19) null,
    update_time      DATETIME(19) null,
    create_user_id   BIGINT(19)   null,
    update_user_id   BIGINT(19)   null
)
    comment '应用表';

